  \"2016-08-11T08:14:55.826287\",\n\t\"name\": \"privately-owned-public-open-space-popos-and-public-art\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Privately-owned public open spaces (POPOS)
  are publicly accessible spaces in forms of plazas, terraces, atriums, small parks,
  and even snippets that are provided and maintained by private developers. In San
  Francisco, POPOS mostly appear in the Downtown office district area. Prior to 1985,
  developers provided POPOS under three general circumstances: voluntarily, in exchange
  for a density bonus, or as a condition of approval. The 1985 Downtown Plan created
  the first systemic requirements for developers to provide publicly accessible open
  space as a part of projects in C-3 Districts. The goal was to provide in the downtown
  quality open space in sufficient quantity and variety to meet the needs of downtown
  workers, residents and visitors.The POPOs data is available in Google KMZ and GIS
  Shapefile formats. The zip file contains a .dbf file which can be viewed in Excel
  or other spreadsheet software. The zip also contains a Google KMZ file of Public
  Artworks provided as part of the Downtown Plan requirement. Download the data by
  clicking on the 'ZIP' button at the top right of this page.For more information
  please visit the POPOS and Public Art website at http://popos.sfplanning.org\",\n\t\"license_title\":
